
drop table INSTRUMENT_HISTORY if exists;
drop table Trade if exists;
drop table client_identification if exists;
drop table portfolio if exists;
drop table PREFERENCES if exists;
drop table Person if exists;


CREATE TABLE Person (
    id NUMBER PRIMARY KEY,
    email VARCHAR2(100),  
    postalcode VARCHAR2(20),  
    name VARCHAR2(100),  
    date_of_birth DATE,
    country VARCHAR2(50), 
    accept_robo_advisor_terms CHAR(1), 
    balance NUMBER(15, 2)  
);

CREATE TABLE Trade (
    cash_value NUMBER(15, 2),
    quantity INT,
    direction VARCHAR2(10), 
    instrument_id VARCHAR2(100),  
    client_id NUMBER,
    trade_id VARCHAR2(100),  
    execution_price NUMBER(15, 2)  
);

CREATE TABLE client_identification (
    type VARCHAR2(50),  
    value VARCHAR2(100),  
    id NUMBER,
    FOREIGN KEY (id) REFERENCES Person (id)
);

CREATE TABLE portfolio (
    client_id NUMBER,
    instrument_id VARCHAR2(50),
    instrument_description VARCHAR2(255),
    bought_price NUMBER,
    quantity NUMBER,
    total_investment NUMBER
);

CREATE TABLE PREFERENCES (
    "CLIENT_ID" NUMBER,
    "INVESTMENT_PURPOSE" VARCHAR(200),
    "RISK_TOLERANCE" VARCHAR(100),
    "INCOME_CATEGORY" VARCHAR(100),
    "LENGTH_OF_INVESTMENT" VARCHAR(100)
);
create table INSTRUMENT_HISTORY (
	instrument_id VARCHAR(7),
	price_date DATE,
	opening_price INT,
	closing_price INT,
	volume_purchased INT,
	category_id VARCHAR(5)
);











